import {Try} from '../joiner';
import {Dashboard} from './components';

import {JQDock} from "../components/dock/MyDock";


function DockTest() {
    let absposstyle = {zIndex:9999, position: 'absolute', top:0, left:0, background:'white', width:'100vw', height:'100vh'};
    return <div id={"myydock"} style={{top:0, left:0, background:'white', width:'100%', height:'100%'}}>
        <JQDock/>
    </div>
}


function UpdatesPage(): JSX.Element {
    return(<Try>
        <Dashboard active={'Updates'} version={{n: 0, date:'fake-date'}}>
            <div>
                <a href={"."}>2.0</a>
                <a href={"."}>2.1</a>
                <a href={"."}>2.2</a>
                <div>
                    <DockTest />
                </div>
            </div>
        </Dashboard>
    </Try>);
}

export {UpdatesPage};
